Dr. Ryan Stone (Sandra Bullock) is een briljante medische ingenieur die op haar eerste shuttlemissie gaat met de ervaren 
astronaut Matt Kowalsky (George Clooney), die het commando heeft over zijn laatste vlucht voor hij met pensioen gaat. 
Maar een schijnbaar routine ruimtewandeling draait uit op een ramp. De shuttle wordt vernietigd waardoor Stone en 
Kowalsky alleen achterblijven - vastgeketend aan elkaar en steeds verder zwevend in het duister. De oorverdovende 
stilte verraadt dat ze elke link met de Aarde verloren hebben ... en elke kans op redding. Angst wordt paniek, en 
elke hap lucht vermindert de nog resterende hoeveelheid zuurstof. Maar misschien is de enige weg naar huis 
verder te gaan in de angstaanjagende uitgestrektheid van de ruimte.


